export const ChartSwitchSvg = ({
  name,
  color,
  type = "",
}: {
  name: string;
  color?: string;
  type?: string;
}) => {
  if (type === "token-specific") {
    switch (name) {
      case "graph":
        return <TokenSpecificGraph color={color} />;
      case "candlestick":
        return <TokenSpecificCandle color={color} />;
      default:
        return <TokenSpecificCandle color={color} />;
    }
  }

  switch (name) {
    case "graph":
      return <GraphSvg color={color} />;
    case "candlestick":
      return <CandleStickSvg color={color} />;
    default:
      return <CandleStickSvg color={color} />;
  }
};

